  @property() type: 'small' | 'normal' = 'small';

  // colums A-I and rows 0-19
  pinInfo: ElementPin[] = [];

  constructSmallPins() {
    for (let col = 0; col < 4; col++) {
      for (let row = 0; row < 4; row++) {
        this.pinInfo.push({
          name: `${String.fromCharCode(65 + col)}${row}`,
          x: 10.3 + col * 17,
          y: 26 + row * 17,
        } as ElementPin);
      }
    }

    for (let col = 0; col < 4; col++) {
      for (let row = 0; row < 4; row++) {
        this.pinInfo.push({
          name: `${String.fromCharCode(69 + col)}${row}`,
          x: 112.7 + col * 17,
          y: 26 + row * 17,
        } as ElementPin);
      }
    }
  }

  constructNormalPins() {
    for (let col = 0; col < 4; col++) {
      for (let row = 0; row < 12; row++) {
        this.pinInfo.push({
          name: `${String.fromCharCode(65 + col)}${row}`,
          x: 10.3 + col * 17.15,
          y: 26 + row * 17.15,
        } as ElementPin);
      }
    }

    for (let col = 0; col < 4; col++) {
      for (let row = 0; row < 12; row++) {
        this.pinInfo.push({
          name: `${String.fromCharCode(69 + col)}${row}`,
          x: 113 + col * 17.15,
          y: 26 + row * 17.15,
        } as ElementPin);
      }
    }
  }

  firstUpdated() {
    const { type } = this;

    if (type === 'small') {
      this.constructSmallPins();
    } else {
      this.constructNormalPins();
    }
  }

